  Switch,
  Route,
  Link,
} from 'react-router-dom';
import Main from './main-cont';

const Manager = () => {
  const [path, setPath] = useState('/manager/add')



  return (
    <Router>
      <Link to={'/manager'} className="header-mngr" dir="rtl">
        <Logo />
      </Link>
      <Main changePath={(e) => {setPath(e);console.log(e);}}/>
      <BottomNav path={path} />
    </Router>
  );
}

export default Manager;
